import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "../notes.js"

function deneme(noteItem){
    return <Note 
    title={noteItem.title}
    content={noteItem.content}
    />
}


function App(){
    return(
        <div>
            <Header/>
            {notes.map(deneme)}
            <Footer/>
            
        </div>
    )
}

export default App;
